script: |
  super -f text -I q933.spq | sort > q933.out

inputs:
  - name: q933.spq
    data: |
      SELECT DISTINCT + ( - 48 ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor2, tab0 (FORMAT parquet) AS cor3;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q933.out
    data: |
      -48
